(20, NULL, 'Widerrufsbelehrung+&+Muster-Widerrufsformular', NULL, '<p>Verbrauchern steht ein Widerrufsrecht nach folgender Ma&szlig;gabe zu, wobei Verbraucher jede nat&uuml;rliche Person ist, die ein Rechtsgesch&auml;ft zu Zwecken abschlie&szlig;t, die &uuml;berwiegend weder ihrer gewerblichen noch ihrer selbst&auml;ndigen beruflichen T&auml;tigkeit zugerechnet werden k&ouml;nnen:<br /> <br />Widerrufsbelehrung</p>\r\n<p>Widerrufsrecht<br />Sie haben das Recht, binnen 14 Tagen ohne Angabe von Gr&uuml;nden diesen Vertrag zu widerrufen.</p>\r\n<p>Die Widerrufsfrist betr&auml;gt 14 Tage ab dem Tag, an dem Sie oder ein von Ihnen benannter Dritter, der nicht der Bef&ouml;rderer ist, die letzte Ware in Besitz genommen haben bzw. hat.</p>\r\n<p>Um Ihr Widerrufsrecht auszu&uuml;ben, m&uuml;ssen Sie uns (Dawson &amp; Partners LTD., Suite LP21437,Lower Ground Floor,<br />145-157 St John Street, London, EC1V 4PW, United Kingdom , E-Mail: info@vetfriend24.com) mittels einer eindeutigen Erkl&auml;rung (z. B. ein mit der Post versandter Brief, E-Mail) &uuml;ber Ihren Entschluss, diesen Vertrag zu widerrufen, informieren. Sie k&ouml;nnen daf&uuml;r das beigef&uuml;gte Muster-Widerrufsformular verwenden, das jedoch nicht vorgeschrieben ist.</p>\r\n<p>Zur Wahrung der Widerrufsfrist reicht es aus, dass Sie die Mitteilung &uuml;ber die Aus&uuml;bung des Widerrufsrechts vor Ablauf der Widerrufsfrist absenden.</p>\r\n<p>Folgen des Widerrufs<br />Wenn Sie diesen Vertrag widerrufen, haben wir Ihnen alle Zahlungen, die wir von Ihnen erhalten haben, einschlie&szlig;lich der Lieferkosten (mit Ausnahme der zus&auml;tzlichen Kosten, die sich daraus ergeben, dass Sie eine andere Art der Lieferung als die von uns angebotene, g&uuml;nstigste Standardlieferung gew&auml;hlt haben), unverz&uuml;glich und sp&auml;testens binnen vierzehn Tagen ab dem Tag zur&uuml;ckzuzahlen, an dem die Mitteilung &uuml;ber Ihren Widerruf dieses Vertrags bei uns eingegangen ist. F&uuml;r diese R&uuml;ckzahlung verwenden wir dasselbe Zahlungsmittel, das Sie bei der urspr&uuml;nglichen Transaktion eingesetzt haben, es sei denn, mit Ihnen wurde ausdr&uuml;cklich etwas anderes vereinbart; in keinem Fall werden Ihnen wegen dieser R&uuml;ckzahlung Entgelte berechnet. Wir k&ouml;nnen die R&uuml;ckzahlung verweigern, bis wir die Waren wieder zur&uuml;ckerhalten haben oder bis Sie den Nachweis erbracht haben, dass Sie die Waren zur&uuml;ckgesandt haben, je nachdem, welches der fr&uuml;here Zeitpunkt ist.</p>\r\n<p>Sie haben die Waren unverz&uuml;glich und in jedem Fall sp&auml;testens binnen vierzehn Tagen ab dem Tag, an dem Sie uns &uuml;ber den Widerruf dieses Vertrags unterrichten, an uns oder an Dawson &amp; Partners LTD., Suite LP21437,Lower Ground Floor, 145-157 St John Street, London, EC1V 4PW, United Kingdom , E-Mail: info@vetfriend24.com zur&uuml;ckzusenden oder zu &uuml;bergeben. Die Frist ist gewahrt, wenn Sie die Waren vor Ablauf der Frist von vierzehn Tagen absenden. Wir tragen die Kosten der R&uuml;cksendung solcher Waren, die aufgrund ihrer Beschaffenheit normal mit der Post an uns zur&uuml;ckgesandt werden k&ouml;nnen. Sie tragen die unmittelbaren Kosten der R&uuml;cksendung solcher Waren, die aufgrund ihrer Beschaffenheit nicht normal mit der Post an uns zur&uuml;ckgesandt werden k&ouml;nnen (Speditionsware), welche f&uuml;r jede derartige Ware auf h&ouml;chstens etwa 80 Euro gesch&auml;tzt werden</p>\r\n<p>Sie m&uuml;ssen f&uuml;r einen etwaigen Wertverlust der Waren nur aufkommen, wenn dieser Wertverlust auf einen zur Pr&uuml;fung der Beschaffenheit, Eigenschaften und Funktionsweise der Waren nicht notwendigen Umgang mit ihnen zur&uuml;ckzuf&uuml;hren ist.</p>\r\n<p>Ausschluss bzw. vorzeitiges Erl&ouml;schen des Widerrufsrechts:<br />Das Widerrufsrecht erlischt vorzeitig bei Vertr&auml;gen<br />- zur Lieferung versiegelter Waren, die aus Gr&uuml;nden des Gesundheitsschutzes oder der Hygiene nicht zur R&uuml;ckgabe geeignet sind, wenn ihre Versiegelung nach der Lieferung entfernt wurde;</p>\r\n<p><br /> <br />Muster-Widerrufsformular</p>\r\n<p>(Wenn Sie den Vertrag widerrufen wollen, dann f&uuml;llen Sie bitte dieses Formular aus und senden Sie es zur&uuml;ck.)</p>\r\n<p>- Dawson &amp; Partners LTD., Suite LP21437,Lower Ground Floor, 145-157 St John Street, London, EC1V 4PW, United Kingdom, E-Mail: info@vetfriend24.com</p>\r\n<p>-Hiermit widerrufe(n) ich/wir(*) den von mir/uns abgeschlossenen Vertrag &uuml;ber den Kauf der folgenden Waren (*)/ die Erbringung der folgenden Dienstleistung (*)</p>\r\n<p>&nbsp;</p>\r\n<p>-Bestellt am (*) /erhalten am (*)</p>\r\n<p><br />-Name des/der Verbraucher(s)</p>\r\n<p>-Anschrift des/der Verbraucher(s)</p>\r\n<p>-Unterschrift des/der Verbraucher(s) (nur bei Mitteilung auf Papier)</p>\r\n<p>-Datum</p>\r\n<p>(*) Unzutreffendes streichen</p>', NULL, 1),
(21, NULL, 'Information-zur-Batterieentsorgung', NULL, '<p>Hinweis zur Entsorgung von Altbatterien</p>\r\n<p>Der nachfolgende Hinweis richtet sich an diejenigen, die Batterien oder Produkte mit eingebauten Batterien nutzen und in der an sie gelieferten Form nicht mehr weiterver&auml;u&szlig;ern (Endnutzer):<br />Unentgeltliche R&uuml;cknahme von Altbatterien</p>\r\n<p>Batterien d&uuml;rfen nicht &uuml;ber den Hausm&uuml;ll entsorgt werden. Sie sind zur R&uuml;ckgabe von Altbatterien gesetzlich verpflichtet, damit eine fachgerechte Entsorgung gew&auml;hrleistet werden kann. Sie k&ouml;nnen Altbatterien an einer kommunalen Sammelstelle oder im Handel vor Ort abgeben. Auch wir sind als Vertreiber von Batterien zur R&uuml;cknahme von Altbatterien verpflichtet, wobei sich unsere R&uuml;cknahmeverpflichtung auf Altbatterien der Art beschr&auml;nkt, die wir als Neubatterien in unserem Sortiment f&uuml;hren oder gef&uuml;hrt haben. Altbatterien vorgenannter Art k&ouml;nnen Sie daher entweder ausreichend frankiert an uns zur&uuml;cksenden oder sie direkt an unserem Versandlager unter der folgenden Adresse unentgeltlich abgeben:<br />Dawson &amp; Partners LTD.<br />Suite LP21437<br />Lower Ground Floor<br />145-157 St John Street<br />London<br />EC1V 4PW<br />United Kingdom <br />Bedeutung der Batteriesymbole</p>\r\n<p>Batterien sind mit dem Symbol einer durchgekreuzten M&uuml;lltonne gekennzeichnet. Dieses Symbol weist darauf hin, dass Batterien nicht in den Hausm&uuml;ll gegeben werden d&uuml;rfen. Bei Batterien, die mehr als 0,0005 Masseprozent Quecksilber, mehr als 0,002 Masseprozent Cadmium oder mehr als 0,004 Masseprozent Blei enthalten, befindet sich unter dem M&uuml;lltonnen-Symbol die chemische Bezeichnung des jeweils eingesetzten Schadstoffes - dabei steht "Cd" f&uuml;r Cadmium, "Pb" steht f&uuml;r Blei, und "Hg" f&uuml;r Quecksilber.</p>', NULL, 1),
(18, NULL, 'ZAHLARTEN UND VERSANDINFORMATIONEN', NULL, '<p>1. Zahlungsm&ouml;glichkeiten</p>\r\n<p>1.1 F&uuml;r Lieferungen innerhalb der europ&auml;ischen Union bieten wir folgende Zahlungsm&ouml;glichkeiten an, sofern in der jeweiligen Produktdarstellung im Angebot nichts anderes bestimmt ist:<br />- Vorauskasse per &Uuml;berweisung<br />- Paypal<br />- Paypal Express<br />- Barzahlung bei Abholung</p>\r\n<p><br />2. Lieferung<br />2.1 Der Versand Ihrer Bestellung erfolgt per Deutsche Post, DPD, DHL, Royal Mail<br />2.2 Wir versenden in folgende L&auml;nder: Europ&auml;ische Union<br />Die jeweils anfallenden Versandkosten finden Sie unter dem Punkt 3.1</p>\r\n<p>3. Versandkosten<br />3.1 F&uuml;r den Versand innerhalb der EU berechnen wir pauschal 6,90&euro;, au&szlig;er es wird gesondert darauf hingewiesen<br />3.2 Bitte beachten Sie, dass bei grenz&uuml;berschreitenden Lieferungen weitere Steuern (etwa im Fall eines innergemeinschaftlichen Erwerbs) und/oder Abgaben, etwa in Form von Z&ouml;llen anfallen k&ouml;nnen, die von Ihnen zu tragen sind.</p>', NULL, 1),
(19, NULL, 'ALLGEMEINE GESCHäFTSBEDINGUNGEN MIT KUNDENINFORMATIONEN', NULL, '<p>1. Geltungsbereich</p>\r\n<p>2. Vertragsschluss<br />3. Widerrufsrecht<br />4. Preise und Zahlungsbedingungen<br />5. Liefer- und Versandkostne<br />6. M&auml;ngelhaftung<br />7. Einl&ouml;sung von Aktionsgutscheinen<br />8. Anwendbares Recht, Gerichtsstand</p>\r\n<p><br />1. Geltungsbereich<br />1.1 Diese Allgemeinen Gesch&auml;ftsbedingungen (nachfolgend "AGB") der "Dawson &amp; Partners LTD." (nachfolgend "Verk&auml;ufer"), gelten f&uuml;r alle Vertr&auml;ge, die ein Verbraucher oder Unternehmer (nachfolgend "Kunde") mit dem Verk&auml;ufer hinsichtlich der vom Verk&auml;ufer in seinem Online-Shop dargestellten Waren und/oder Leistungen abschlie&szlig;t. Hiermit wird der Einbeziehung von eigenen Bedingungen des Kunden widersprochen, es sei denn, es ist etwas anderes vereinbart.<br />1.2 Verbraucher im Sinne dieser AGB ist jede nat&uuml;rliche Person, die ein Rechtsgesch&auml;ft zu Zwecken abschlie&szlig;t, die &uuml;berwiegend weder ihrer gewerblichen noch ihrer selbstst&auml;ndigen beruflichen T&auml;tigkeit zugerechnet werden k&ouml;nnen. Unternehmer im Sinne dieser AGB ist eine nat&uuml;rliche oder juristische Person oder eine rechtsf&auml;hige Personengesellschaft, die bei Abschluss eines Rechtsgesch&auml;fts in Aus&uuml;bung ihrer gewerblichen oder selbst&auml;ndigen beruflichen T&auml;tigkeit handelt.</p>\r\n<p>2. Vertragsschluss<br />2.1 Die im Online-Shop des Verk&auml;ufers enthaltenen Produktdarstellungen stellen keine verbindlichen Angebote seitens des Verk&auml;ufers dar, sondern dienen zur Abgabe eines verbindlichen Angebots durch den Kunden.<br />2.2 Der Kunde kann das Angebot &uuml;ber das in den Online-Shop des Verk&auml;ufers integrierte Online-Bestellformular abgeben. Dabei gibt der Kunde, nachdem er die ausgew&auml;hlten Waren und/oder Leistungen in den virtuellen Warenkorb gelegt und den elektronischen Bestellprozess durchlaufen hat, durch Klicken des den Bestellvorgang abschlie&szlig;enden Buttons ein rechtlich verbindliches Vertragsangebot in Bezug auf die im Warenkorb enthaltenen Waren und/oder Leistungen ab. <br />2.3 Der Verk&auml;ufer kann das Angebot des Kunden innerhalb von f&uuml;nf Tagen annehmen,</p>\r\n<p>- indem er dem Kunden eine schriftliche Auftragsbest&auml;tigung oder eine Auftragsbest&auml;tigung in Textform (Fax oder E-Mail) &uuml;bermittelt, wobei insoweit der Zugang der Auftragsbest&auml;tigung beim Kunden ma&szlig;geblich ist, oder</p>\r\n<p>- indem er dem Kunden die bestellte Ware liefert, wobei insoweit der Zugang der Ware beim Kunden ma&szlig;geblich ist, oder<br /> <br />- indem er den Kunden nach Abgabe von dessen Bestellung zur Zahlung auffordert.</p>\r\n<p>Liegen mehrere der vorgenannten Alternativen vor, kommt der Vertrag in dem Zeitpunkt zustande, in dem eine der vorgenannten Alternativen zuerst eintritt. Nimmt der Verk&auml;ufer das Angebot des Kunden innerhalb vorgenannter Frist nicht an, so gilt dies als Ablehnung des Angebots mit der Folge, dass der Kunde nicht mehr an seine Willenserkl&auml;rung gebunden ist.<br />2.4 W&auml;hlt der Kunde im Rahmen des Bestellvorgangs "PayPal Express" als Zahlungsart aus, erteilt er durch Klicken des den Bestellvorgang abschlie&szlig;enden Buttons zugleich auch einen Zahlungsauftrag an seinen Zahlungsdienstleister. F&uuml;r diesen Fall erkl&auml;rt der Verk&auml;ufer abweichend von Ziffer 2.3 schon jetzt die Annahme des Angebots des Kunden in dem Zeitpunkt, in dem der Kunde durch Klicken des den Bestellvorgang abschlie&szlig;enden Buttons den Zahlungsvorgang ausl&ouml;st.<br />2.5 Die Frist zur Annahme des Angebots beginnt am Tag nach der Absendung des Angebots durch den Kunden zu laufen und endet mit dem Ablauf des f&uuml;nften Tages, welcher auf die Absendung des Angebots folgt.<br />2.6 Bei der Abgabe eines Angebots &uuml;ber das Online-Bestellformular des Verk&auml;ufers wird der Vertragstext vom Verk&auml;ufer gespeichert und dem Kunden nach Absendung seiner Bestellung nebst den vorliegenden AGB in Textform (z. B. E-Mail, Fax oder Brief) zugeschickt. Zus&auml;tzlich wird der Vertragstext auf der Internetseite des Verk&auml;ufers archiviert und kann vom Kunden &uuml;ber sein passwortgesch&uuml;tztes Kundenkonto unter Angabe der entsprechenden Login-Daten kostenlos abgerufen werden, sofern der Kunde vor Absendung seiner Bestellung ein Kundenkonto im Online-Shop des Verk&auml;ufers angelegt hat.<br />2.7 Vor verbindlicher Abgabe der Bestellung &uuml;ber das Online-Bestellformular des Verk&auml;ufers kann der Kunde seine Eingaben laufend &uuml;ber die &uuml;blichen Tastatur- und Mausfunktionen korrigieren. Dar&uuml;ber hinaus werden alle Eingaben vor der verbindlichen Abgabe der Bestellung noch einmal in einem Best&auml;tigungsfenster angezeigt und k&ouml;nnen auch dort mittels der &uuml;blichen Tastatur- und Mausfunktionen korrigiert werden.<br />2.8 F&uuml;r den Vertragsschluss steht ausschlie&szlig;lich die deutsche Sprache zur Verf&uuml;gung.<br />2.9 Die Bestellabwicklung und Kontaktaufnahme finden in der Regel per E-Mail und automatisierter Bestellabwicklung statt. Der Kunde hat sicherzustellen, dass die von ihm zur Bestellabwicklung angegebene E-Mail-Adresse zutreffend ist, so dass unter dieser Adresse die vom Verk&auml;ufer versandten E-Mails empfangen werden k&ouml;nnen. Insbesondere hat der Kunde bei dem Einsatz von SPAM-Filtern sicherzustellen, dass alle vom Verk&auml;ufer oder von diesem mit der Bestellabwicklung beauftragten Dritten versandten Mails zugestellt werden k&ouml;nnen.</p>\r\n<p>3. Widerrufsrecht<br />3.1 Verbrauchern steht grunds&auml;tzlich ein Widerrufsrecht zu. <br />3.2 N&auml;here Informationen zum Widerrufsrecht ergeben sich aus der Widerrufsbelehrung des Verk&auml;ufers.<br />3.3 Das Widerrufsrecht gilt nicht f&uuml;r Verbraucher, die zum Zeitpunkt des Vertragsschlusses keinem Mitgliedstaat der Europ&auml;ischen Union angeh&ouml;ren und deren alleiniger Wohnsitz und Lieferadresse zum Zeitpunkt des Vertragsschlusses au&szlig;erhalb der Europ&auml;ischen Union liegen.</p>\r\n<p>4. Preise und Zahlungsbedingungen<br />4.1 Sofern sich aus der Produktbeschreibung des Verk&auml;ufers nichts anderes ergibt, handelt es sich bei den angegebenen Preisen um Gesamtpreise, die die gesetzliche Umsatzsteuer enthalten. Gegebenenfalls zus&auml;tzlich anfallende Liefer- und Versandkosten werden in der jeweiligen Produktbeschreibung gesondert angegeben.<br />4.2 Bei Lieferungen in L&auml;nder au&szlig;erhalb der Europ&auml;ischen Union k&ouml;nnen im Einzelfall weitere Kosten anfallen, die der Verk&auml;ufer nicht zu vertreten hat und die vom Kunden zu tragen sind. Hierzu z&auml;hlen beispielsweise Kosten f&uuml;r die Geld&uuml;bermittlung durch Kreditinstitute (z.B. &Uuml;berweisungsgeb&uuml;hren, Wechselkursgeb&uuml;hren) oder einfuhrrechtliche Abgaben bzw. Steuern (z.B. Z&ouml;lle). Solche Kosten k&ouml;nnen in Bezug auf die Geld&uuml;bermittlung auch dann anfallen, wenn die Lieferung nicht in ein Land au&szlig;erhalb der Europ&auml;ischen Union erfolgt, der Kunde die Zahlung aber von einem Land au&szlig;erhalb der Europ&auml;ischen Union aus vornimmt.<br />4.3 Dem Kunden stehen verschiedene Zahlungsm&ouml;glichkeiten zur Verf&uuml;gung, die im Online-Shop des Verk&auml;ufers angegeben werden.<br />4.4 Ist Vorauskasse vereinbart, ist die Zahlung sofort nach Vertragsabschluss f&auml;llig.<br />4.5 Bei Auswahl der Zahlungsart "PayPal" erfolgt die Zahlungsabwicklung &uuml;ber den Zahlungsdienstleister PayPal (Europe) S.&agrave; r.l. et Cie, S.C.A., 22-24 Boulevard Royal, L-2449 Luxembourg, unter Geltung der PayPal-Nutzungsbedingungen, einsehbar unter https://www.paypal.com/de/webapps/mpp/ua/useragreement-full. Dies setzt u. a. voraus, dass der Kunde ein PayPal-Konto er&ouml;ffnet bzw. bereits &uuml;ber ein solches Konto verf&uuml;gt.</p>\r\n<p>5. Liefer- und Versandkostne<br />5.1 Die Lieferung von Waren erfolgt regelm&auml;&szlig;ig auf dem Versandwege und an die vom Kunden angegebene Lieferanschrift. Bei der Abwicklung der Transaktion, ist die in der Kaufabwicklung des Verk&auml;ufers angegebene Lieferanschrift ma&szlig;geblich. Abweichend hiervon ist bei Auswahl der Zahlungsart PayPal die vom Kunden zum Zeitpunkt der Bezahlung bei PayPal hinterlegte Lieferanschrift ma&szlig;geblich.<br />5.2 Sendet das Transportunternehmen die versandte Ware an den Verk&auml;ufer zur&uuml;ck, da eine Zustellung beim Kunden nicht m&ouml;glich war, tr&auml;gt der Kunde die Kosten f&uuml;r den erfolglosen Versand. Dies gilt nicht, wenn er den Umstand, der zur Unm&ouml;glichkeit der Zustellung gef&uuml;hrt hat, nicht zu vertreten hat oder wenn er vor&uuml;bergehend an der Annahme der angebotenen Leistung verhindert war, es sei denn, dass der Verk&auml;ufer ihm die Leistung eine angemessene Zeit vorher angek&uuml;ndigt hatte.<br />5.3 Bei Selbstabholung informiert der Verk&auml;ufer den Kunden zun&auml;chst per E-Mail dar&uuml;ber, dass die von ihm bestellte Ware zur Abholung bereit steht. Nach Erhalt dieser E-Mail kann der Kunde die Ware nach Absprache mit dem Verk&auml;ufer am Sitz des Verk&auml;ufers abholen. In diesem Fall werden keine Versandkosten berechnet.<br />5.4 Gutscheine werden dem Kunden per E-Mail, per Download oder postalisch &uuml;berlassen.</p>\r\n<p>6. M&auml;ngelhaftung<br />Es gilt die gesetzliche M&auml;ngelhaftung</p>\r\n<p>7. Einl&ouml;sung von Aktionsgutscheinen<br />7.1 Gutscheine, die vom Verk&auml;ufer im Rahmen von Werbeaktionen mit einer bestimmten G&uuml;ltigkeitsdauer unentgeltlich ausgegeben werden und die vom Kunden nicht k&auml;uflich erworben werden k&ouml;nnen (nachfolgend "Aktionsgutscheine"), k&ouml;nnen nur im Online-Shop des Verk&auml;ufers und nur im angegebenen Zeitraum eingel&ouml;st werden.<br />7.2 Einzelne Produkte k&ouml;nnen von der Gutscheinaktion ausgeschlossen sein, sofern sich eine entsprechende Einschr&auml;nkung aus dem Inhalt des Aktionsgutscheins ergibt.<br />7.3 Aktionsgutscheine k&ouml;nnen nur vor Abschluss des Bestellvorgangs eingel&ouml;st werden. Eine nachtr&auml;gliche Verrechnung ist nicht m&ouml;glich.<br />7.4 Pro Bestellung kann immer nur ein Aktionsgutschein eingel&ouml;st werden. <br />7.5 Der Warenwert muss mindestens dem Betrag des Aktionsgutscheins entsprechen. Etwaiges Restguthaben wird vom Verk&auml;ufer nicht erstattet.<br />7.6 Reicht der Wert des Aktionsgutscheins zur Deckung der Bestellung nicht aus, kann zur Begleichung des Differenzbetrages eine der &uuml;brigen vom Verk&auml;ufer angebotenen Zahlungsarten gew&auml;hlt werden<br />7.7 Das Guthaben eines Aktionsgutscheins wird weder in Bargeld ausgezahlt noch verzinst.<br />7.8 Der Aktionsgutschein wird nicht erstattet, wenn der Kunde die mit dem Aktionsgutschein ganz oder teilweise bezahlte Ware im Rahmen seines gesetzlichen Widerrufsrechts zur&uuml;ckgibt.<br />7.9 Der Aktionsgutschein ist &uuml;bertragbar. Der Verk&auml;ufer kann mit befreiender Wirkung an den jeweiligen Inhaber, der den Aktionsgutschein im Online-Shop des Verk&auml;ufers einl&ouml;st, leisten. Dies gilt nicht, wenn der Verk&auml;ufer Kenntnis oder grob fahrl&auml;ssige Unkenntnis von der Nichtberechtigung, der Gesch&auml;ftsunf&auml;higkeit oder der fehlenden Vertretungsberechtigung des jeweiligen Inhabers hat.</p>\r\n<p>8. Anwendbares Recht, Gerichtsstand<br />8.1 F&uuml;r s&auml;mtliche Rechtsbeziehungen der Parteien gilt das Recht der Bundesrepublik Deutschland unter Ausschluss der Gesetze &uuml;ber den internationalen Kauf beweglicher Waren. Bei Verbrauchern gilt diese Rechtswahl nur insoweit, als nicht der gew&auml;hrte Schutz durch zwingende Bestimmungen des Rechts des Staates, in dem der Verbraucher seinen gew&ouml;hnlichen Aufenthalt hat, entzogen wird.<br />8.2 Handelt der Kunde als Kaufmann, juristische Person des &ouml;ffentlichen Rechts oder &ouml;ffentlich-rechtliches Sonderverm&ouml;gen mit Sitz im Hoheitsgebiet der Bundesrepublik Deutschland, ist ausschlie&szlig;licher Gerichtsstand f&uuml;r alle Streitigkeiten aus diesem Vertrag der Gesch&auml;ftssitz des Verk&auml;ufers. Hat der Kunde seinen Sitz au&szlig;erhalb des Hoheitsgebiets der Bundesrepublik Deutschland, so ist der Gesch&auml;ftssitz des Verk&auml;ufers ausschlie&szlig;licher Gerichtsstand f&uuml;r alle Streitigkeiten aus diesem Vertrag, wenn der Vertrag oder Anspr&uuml;che aus dem Vertrag der beruflichen oder gewerblichen T&auml;tigkeit des Kunden zugerechnet werden k&ouml;nnen. Der Verk&auml;ufer ist in den vorstehenden F&auml;llen jedoch in jedem Fall berechtigt, das Gericht am Sitz des Kunden anzurufen.<br />8.3 Ferner gilt diese Rechtswahl im Hinblick auf das gesetzliche Widerrufsrecht nicht bei Verbrauchern, die zum Zeitpunkt des Vertragsschlusses keinem Mitgliedstaat der Europ&auml;ischen Union angeh&ouml;ren und deren alleiniger Wohnsitz und Lieferadresse zum Zeitpunkt des Vertragsschlusses au&szlig;erhalb der Europ&auml;ischen Union liegen. </p>', NULL, 1),
(6, NULL, 'Die Ernährung ', '<h1>&nbsp;</h1>', '<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/01-1.jpg" alt="" width="640" height="386" />&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Der Hund ist ein Allesfresser - &auml;hnlich uns Menschen. Diese Eigenschaft hat unser treuer Begleiter von seinen Vorfahren, den W&ouml;lfen, geerbt. Die wild lebenden "Selbstversorger" fressen nicht nur das Fleisch erlegter Beutetiere, sondern auch deren Innereien einschlie&szlig;lich des Inhalts von Magen und Darm. Au&szlig;erdem nehmen sie pflanzliche N&auml;hrstoffe wie Wurzeln und Gr&auml;ser auf. <br /><br />Beim Wolf wie beim Hund gilt daher:</div>\r\n<div>&nbsp;</div>\r\n<div><strong>1. Optimale Leistung braucht optimale Ern&auml;hrung.</strong>&nbsp;</div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div>Picture here************</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>2. Gutes Futter bildet die Grundlage f&uuml;r Gesundheit, Leistungsf&auml;higkeit und ein langes Leben.&nbsp;</strong></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Picture here******************</div>\r\n<div>&nbsp;</div>\r\n<div><strong>3. Falsche Ern&auml;hrung kann den Hund krank machen.</strong></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/01-4.jpg" alt="" width="319" height="235" />&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h1><strong>Wie viel Futter braucht mein Hund? &nbsp;</strong></h1>\r\n<div>&nbsp;</div>\r\n<div>Wichtig f&uuml;r einen Hund ist die ausreichende Versorgung mit Energie in allen Lebensphasen. Diese richtet sich nach seiner Lebenssituation. Ist der Hund sportlich, aktiv, wird er im Freien oder in der Wohnung gehalten? Fragen, die jeder Halter vorher beantworten sollte. Ein aktiver Hund zum Beispiel braucht mehr, ein ruhiger Hund weniger Futter. <br />Als grober Anhalt gilt diese Faustregel: Ein erwachsener Hund ohne besondere Belastungen ben&ouml;tigt t&auml;glich pro Kilogramm seiner K&ouml;rpermasse etwa 57 kcal Futter. Bei kleinen Hunderassen liegen die Werte etwas h&ouml;her. Welpen brauchen rund 100 bis 170 kcal, Zuchth&uuml;ndinnen in der zweiten H&auml;lfte der S&auml;ugeleistung sogar 100 bis 300 kcal. Ein &auml;lterer Hund braucht oft weniger, ein sehr alter Hund dann wieder etwas mehr Energie im Futter.&nbsp;</div>\r\n<h1>Was muss im Futter drin sein? &nbsp;</h1>\r\n<div>\r\n<p>Beim Fertigfutter ist die richtige Berechnung f&uuml;r die Ern&auml;hrung des eigenen Hundes relativ einfach: Man richtet sich nach den Angaben der Hersteller und rechnet mit etwa 10 Prozent weniger Futter als angegeben. Bei selbst hergestellten Rationen ist eine sorgf&auml;ltige Berechnung aller N&auml;hrstoffe mit Hilfe von Tabellen in entsprechenden B&uuml;chern der einzige Weg. Und vergessen Sie nicht die Leckereien, die Ihr Hund zwischendurch bekommt. <br />Auch in Hundekeksen stecken Kalorien!</p>\r\n<p>Eiwei&szlig;, Fett, Kohlenhydrate, Vitamine und Spurenelemente sind die Hauptn&auml;hrstoffe, die in gutem Hundefutter enthalten sein sollten. Sie liefern Energie, die Ihr Hund f&uuml;r die Erhaltung aller lebensnotwendigen Funktionen braucht.</p>\r\n&nbsp;</div>\r\n<div>&nbsp;Read more button**********************************</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Eiwei&szlig;</strong> hat den Zweck, K&ouml;rpergewebe aufzubauen und zu st&auml;rken. Die in Eiwei&szlig; enthaltenen Aminos&auml;uren sind f&uuml;r den Hund lebensnotwendig. Von ihnen gibt es 25. Davon sind 12 f&uuml;r den Hund essentiell, das hei&szlig;t, er kann sie nicht selbst aufbauen. <br />Fleisch ist eine besonders hochwertige Eiwei&szlig;quelle. Ihr Proteingehalt betr&auml;gt mindestens 18 Prozent in der Frisch- und etwa die H&auml;lfte davon in der Trockensubstanz. Auch Fisch ist eine gute Alternative f&uuml;r den Hund. Zudem hat das Futter aus dem Meer einen hohen Anteil an Vitamin D und unges&auml;ttigten Fetts&auml;uren, die allerdings nur in frischem Fisch vorhanden sind. Bei Fischmehl wurden Vitamin D und &Ouml;le entzogen. <br /><br /><strong>Fette</strong> bestehen aus Glyzerin und Fetts&auml;uren und liefern lebensnotwendige S&auml;uren, Vitamine (A, D, K und E) und geben dem Hund Energie. Die Linols&auml;ure ist f&uuml;r den Hund wesentlich. Besondere Bedeutung kommt einigen unges&auml;ttigten Fetts&auml;uren zu, da sie Einfluss auf Entz&uuml;ndungsreaktionen bzw. die Immunabwehr haben. Ein Hund ben&ouml;tigt pflanzliche sowie tierische Fette, beide sollten &uuml;ber die Ern&auml;hrung zugef&uuml;hrt werden. <br /><br />Achtung: Der Fettanteil im Futter muss jedoch deutlich hinter dem anderer Energietr&auml;ger wie Protein oder Kohlenhydrate stehen. Andernfalls f&uuml;hrt es beim Hund zu &Uuml;bergewicht. <br /><br /><strong>Kohlenhydrate</strong> stammen vor allem aus Pflanzen und sind aus Zuckermolek&uuml;len aufgebaut. Sie werden zur Energiegewinnung und beim Zellaufbau ben&ouml;tigt und regeln die Darmmotorik. Damit sind sie zwar ein n&uuml;tzlicher, aber nicht unbedingt lebensnotwendiger Bestandteil der h&uuml;ndischen Ern&auml;hrung. Hauptlieferant f&uuml;r Kohlenhydrate sind Getreide und Kartoffeln. Domestizierten Hunden werden oft auch Backwaren serviert. Da der Hund nicht viele Kohlenhydrate braucht, jedes handels&uuml;bliche Trockenfutter aber mindestens eine Kohlenhydrat-Quelle enth&auml;lt, hat eine Unterversorgung hier eher Seltenheitswert. <br /><br />Beachten Sie: Gerste, Dinkel, Roggen, Hirse, Hafer kann der Hund nicht selbst aufschl&uuml;sseln, deswegen sollten diese Getreidesorten &uuml;ber Nacht eingeweicht und am n&auml;chsten Tag kurz aufgekocht werden. Am besten vertr&auml;gt der Hund geschrotetes Getreide in Flockenform wie Haferflocken oder Hirseflocken. Getreide im Hundefutter sollte immer vollwertig sein, nicht gesch&auml;lt. <br /><br /><strong>Vitamine und Spurenelemente</strong> k&ouml;nnen vom Hund nicht selbst gebildet werden und sind ebenfalls lebensnotwendig. Dabei reicht es nicht aus, von jedem dieser N&auml;hrstoffe jeweils nur ein errechnetes Minimum an den Hund zu verf&uuml;ttern. Denn: Zwischen den aufgenommenen N&auml;hrstoffen gibt es zahlreiche Wechselbeziehungen. Oft kann ein zu wenig verabreichter N&auml;hrstoff dazu f&uuml;hren, dass auch andere N&auml;hrstoffe nicht ausreichend vom K&ouml;rper genutzt werden k&ouml;nnen. Umgekehrt kann es zu schweren gesundheitlichen Sch&auml;den beim Hund f&uuml;hren, wenn bestimmte N&auml;hrstoffe in zu gro&szlig;er Menge gef&uuml;ttert werden. Und schlie&szlig;lich geh&ouml;ren bei vielen Krankheiten spezielle Ern&auml;hrungsprogramme (Di&auml;t) zur Therapie. Aus diesen Zusammenh&auml;ngen geht hervor, dass eine einseitige Fleischern&auml;hrung f&uuml;r den Hund nicht ausreichend, sondern sogar gesundheitssch&auml;dlich ist.</div>\r\n<h1><strong>Trocken oder aus der Dose?</strong></h1>\r\n<div>Ob aus Unsicherheit, Zeitmangel oder Bequemlichkeit - wenn der Hund Hunger hat, greifen rund 84 Prozent aller Hundebesitzer ins Fertigfutterregal, so eine Studie der Unternehmensberatung BBE. Au&szlig;erdem fallen bei Single- und Kleinhaushalten oftmals weniger Essensreste ab, die in der Vergangenheit f&uuml;r den Hund gedacht waren. Kein Grund zur Sorge: In Trocken- und so genanntem Nassfutter sind alle notwendigen N&auml;hrstoffe f&uuml;r die Ern&auml;hrung des Hundes enthalten. Typisches Nassfutter enth&auml;lt etwa 80 Prozent Wasser, Trockenfutter unter 10 Prozent. Das bedeutet aber, dass mit einer scheinbar kleinen Menge Trockenfutter schnell zu viel gef&uuml;ttert werden kann! Da Trockenfutter infolge des niedrigen Wassergehalts f&uuml;nffach h&ouml;her konzentriert ist, erh&auml;lt der Hund n&auml;mlich viel schneller zu hohe Mengen an N&auml;hrstoffen und vor allem Energie. Eine Gefahr bei Feuchtfutter ist der m&ouml;glicherweise hohe Eiwei&szlig;gehalt. Achten Sie darauf! <br /><br />&Uuml;brigens: In Fertigfuttermitteln sind Vitamine in sehr hohen Mengen enthalten. Ob enthaltene Vitamine nat&uuml;rlich oder k&uuml;nstlich synthetisiert sind, k&ouml;nnen Sie aus der Deklaration ersehen: Werden sie unter "Zusammensetzung" aufgelistet, wurden sie k&uuml;nstlich zugef&uuml;gt, nat&uuml;rlich enthaltene Vitamine findet man nur in der Analyse.&nbsp;</div>\r\n<h1><strong>Viel Trinken ist f&uuml;r Hunde wichtig &nbsp;</strong></h1>\r\n<div>Wasserentzug ist im Gegensatz zum Nahrungsentzug auch beim Hund innerhalb weniger Tage t&ouml;dlich. Die t&auml;glich erforderliche Trinkmenge unterscheidet sich dabei deutlich bei der F&uuml;tterung von Nass- bzw. Trockenfutter. Liegt bei einer Gabe von Nassfutter (aus der Dose oder der eigenen K&uuml;che) die t&auml;gliche Wasserration etwa bei 5 bis 10 ml pro Kilogramm K&ouml;rpermasse, sollten Sie bei einer F&uuml;tterung mit Trockenfutter darauf achten, dass deutlich mehr (40-50 ml) getrunken wird. &nbsp;</div>\r\n<h1>Die richtige Ration finden&nbsp;</h1>\r\n<div>Ein richtig ern&auml;hrter Hund wirkt vital, er hat ein glattes, gl&auml;nzendes Fell, normalen Kot- und Urinabsatz. Der Hund sollte kr&auml;ftige Z&auml;hne, gesundes Zahnfleisch und geruchsarmen Atem haben. Die Augen m&uuml;ssen klar und gl&auml;nzend sein, die Nase sauber, glatt und feucht. Auch die Vitalit&auml;t des Hundes gibt Auskunft &uuml;ber die Qualit&auml;t und Ausgewogenheit seiner Ern&auml;hrung. <br /><br />&Uuml;ber- oder Untergewicht kann man durch Abtasten beurteilen. Sind die Rippen leicht zu ertasten, ohne dass sie unter der Haut sichtbar sind, so d&uuml;rfte das Normalgewicht erreicht sein. Zur Kontrolle von Abweichungen nach unten (kommt eher selten vor) oder nach oben (h&auml;ufiger bekannt) ist regelm&auml;&szlig;iges Wiegen wichtig. Als Vergleich sind so genannte Standardgewichte der Rassen wenig geeignet. Man vergleicht besser mit einem normalgewichtigen, gleich gro&szlig;en und &auml;hnlich gebauten Hund. Noch besser ist es, wenn das urspr&uuml;ngliche Normalgewicht aus der Vergangenheit bekannt ist.&nbsp;</div>\r\n<h1>Wie viele Mahlzeiten am Tag sind sinnvoll?&nbsp;</h1>\r\n<div>Ein Hund sollte ein- bis zweimal t&auml;glich gef&uuml;ttert werden und danach eine Ruhephase von mehreren Stunden haben. F&uuml;r die unterschiedlichen Altersgruppen und Leistungen werden au&szlig;erdem verschiedene Mengen an Energie und N&auml;hrstoffen gebraucht. &Auml;hnlich verh&auml;lt es sich mit den Eiwei&szlig;werten und weiteren Inhaltsstoffen. &nbsp;</div>\r\n<h1>Was, wenn der Hund zu viel oder zu wenig frisst?&nbsp;</h1>\r\n<div>\r\n<p>Dem "ewigen Bettler" am Tisch sollte man besser nicht nachgeben! Es ist ein gewaltiger Irrtum zu glauben, dass ein Hund bettelt, weil ihn der Hunger qu&auml;lt. Dies hat genetisch bedingte Ursachen: Der Leitwolf im Rudel bekommt die Beute. Er gibt den anderen W&ouml;lfen davon ab und zeichnet sich auf diese Weise aus. Genau das will der bettelnde Hund. Und da selten ein Rudel vorhanden ist, frisst er eben selbst alles auf.</p>\r\n<p>Ernster wird die Sache, wenn der eigene Hund nicht fressen will. Oft steckt eine Krankheit dahinter, und eine gr&uuml;ndliche tier&auml;rztliche Untersuchung ist n&ouml;tig. Wird dabei nichts gefunden und der Hund m&auml;kelt weiter vor seinem Napf herum, kann man als Hundehalter &uuml;berlegen, den Geschmack des Futters zu ver&auml;ndern. Manche Hunde lieben Honig, andere angew&auml;rmtes, unter das Futter ger&uuml;hrtes Schmalz. Lachs&ouml;l und Lebertran sind ebenfalls beliebte Geschmacksverst&auml;rker, wenn der Hund sein Futter verweigert, etwa nach Trauer. Wenn auch gezieltes Aushungern &uuml;ber Tage nicht hilft, greift als Rettung Leberwurst. Etwas davon einfach unters Futter mischen.&nbsp;</p>\r\n</div>\r\n<h1>Ern&auml;hrung: Was bewirkt gutes Futter beim Hund?&nbsp;</h1>\r\n<div>Eine optimale Ern&auml;hrung geh&ouml;rt zu den wichtigsten Voraussetzungen, damit ein Hund lange lebt und dabei gesund bleibt. Dagegen werden sehr viele Krankheiten durch schlechte Ern&auml;hrung beeinflusst, wie zum Beispiel &Uuml;bergewicht, Diabetes mellitus, Herz-Kreislauf-Erkrankungen, Skelett- und Gelenkerkrankungen, Nierenerkrankungen und sogar Krebs. Dabei kommt es nicht auf die einmalige Verf&uuml;tterung von viel gepriesenen "Wundersubstanzen", sondern auf die regelm&auml;&szlig;ige optimale Ern&auml;hrung des Hundes an. <br /><br />Jede St&ouml;rung in der Ern&auml;hrung kann zum Krankheitsausl&ouml;ser werden. Am Beispiel der Krankheit Krebs, bei der im Hundek&ouml;rper st&auml;ndig entartete Zellen gebildet werden, braucht der K&ouml;rper die entsprechenden Substanzen aus der Nahrung, damit sein Immunsystem diese Zellen vernichten kann. Achten Sie auf gutes Futter im Napf, und "verw&ouml;hnen" Sie Ihren Hund besser nicht mit Schokolade oder ewigen Happen vom Tisch. Widmen Sie sich ihm lieber auf gesunde Art: Gehen Sie mit ihm spazieren oder Ball spielen. Das schafft N&auml;he, tut Ihrer Gesundheit gut und der Ihres Hundes sowieso.</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<h1>&nbsp;</h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>', 'bf0fd-activedog5.jpg', 1),
(7, NULL, 'Osteorthritis', NULL, '<div>Viele Hunde, vor allem &auml;ltere, leiden unter der Osteoarthritis, einem fortschreitenden, degenerativen Prozess.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h1><strong>Was versteht man unter der Osteoarthritis?</strong></h1>\r\n<div>Picture here********************</div>\r\n<div>&nbsp;</div>\r\n<h1>Kann meinem Hund bei Osteoarthritis geholfen werden?&nbsp;</h1>\r\n<div>Was kann passieren, wenn ich meinen gelenkkranken Hund nicht mit einem geeigneten Arzneimittel therapieren lasse?<br />Kann ich entz&uuml;ndungshemmende Medikamente absetzen, sobald eine leichte Besserung der Beweglichkeit sichtbar wird?</div>\r\n<h1>Was versteht man unter der Osteoarthritis?</h1>\r\n<div>Osteoarthritis (auch Osteoarthrose genannt) ist eine chronische, fortschreitende Gelenkerkrankung, die sowohl weiche als auch kn&ouml;cherne Anteile des Gelenks betrifft. Sie verursacht Schmerzen und eine eingeschr&auml;nkte Beweglichkeit des/der betroffenen Gelenks(e). Jedes Gelenk Ihres Hundes kann betroffen sein, bevorzugt sind jedoch Ellbogen, Schulter, H&uuml;fte, Knie und Wirbels&auml;ule.<br />Ein an Osteoarthritis erkrankter Hund kann abh&auml;ngig vom Schweregrad der Erkrankung eines oder mehrere der unten aufgelisteten Symptome zeigen</div>\r\n<div>&nbsp;</div>\r\n<div>Read more button************************</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Leichte, fr&uuml;he Osteoarthritis</strong></div>\r\n<div><br />Steifer Gang, verminderte Aktivit&auml;t, Lahmheit<br /><br /><strong>Mittelgradige Osteoarthritis: </strong></div>\r\n<div><br />Lahmheit, Schmerz, Muskelschwund, steifer Gang, Schwierigkeiten beim Aufstehen<br /><br /><strong>Schwere, sp&auml;te Osteoarthritis: </strong></div>\r\n<div><br />Lahmheit, Bewegungsunlust, Muskelschwund, Jaulen, Schmerz, Schwierigkeiten beim Aufstehen, Knacken der Gelenke w&auml;hrend der Bewegung, allgemeine Abgeschlagenheit</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Teufelskreis der Schmerzen:</strong></div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/02-5.jpg" alt="" width="280" height="226" /></div>', '68bbc-activedog5.jpg', 1),
(8, NULL, 'Gelenkprobleme beim Hund', NULL, '<div><strong>Gelenkprobleme beim Hund: &nbsp;&nbsp;</strong></div>\r\n<div>&nbsp;</div>\r\n<div>Schmerzfrei ins hohe Hundealter kommen &ndash; das w&uuml;nschen wohl alle Hundebesitzer ihrem Liebsten. Gelenkprobleme beim Hund treten allerdings bei &auml;lteren und vor allem gro&szlig;en Vierbeinern immer h&auml;ufiger auf. <br /><br />Mit diesen Tipps k&ouml;nnen Sie Gelenkproblemen beim Hund vorbeugen:</div>\r\n<div>&nbsp;</div>\r\n<h1><strong>&Uuml;bergewicht vermeiden</strong></h1>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/03-2.jpg" alt="" width="340" height="184" /></div>\r\n<div>&nbsp;</div>\r\n<div>Dieser Tipp ist eigentlich eine Selbstverst&auml;ndlichkeit: &Uuml;bergewicht ist weder f&uuml;r Mensch noch Tier gesund und eine der Hauptursachen f&uuml;r Gelenkprobleme beim Hund. Jedes Kilo zu viel kann die Gelenke Ihres Hundes belasten und zu schwerwiegenden Problemen im Alter f&uuml;hren, weshalb Sie vorbeugen sollten. Wenn Ihr Hund bereits etwas zu viel auf den Rippen hat, helfen eine Di&auml;t und ausreichend Bewegung. Hier gilt es, auf das richtige Ma&szlig; zu achten.</div>\r\n<div>&nbsp;</div>\r\n<h1>Viel Bewegung&nbsp;</h1>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/03-3.jpg" alt="" width="500" height="281" /></div>\r\n<div>&nbsp;</div>\r\n<div>Grunds&auml;tzlich gilt: Bewegung f&ouml;rdert die Gelenkgesundheit. Gleichm&auml;&szlig;ige Bewegungen in einem gem&auml;&szlig;igten Tempo sind gelenkschonender als st&auml;ndige Spr&uuml;nge und abrupte Stopps. <br /><br />Wichtiger Tipp: Achten Sie darauf, dass sich Ihr Hund beim Auslauf erst ein wenig aufw&auml;rmt und nicht direkt zu Beginn einem Stock oder Ball hinterhersprintet.</div>\r\n<div>&nbsp;</div>\r\n<h1>Richtige Ern&auml;hrung&nbsp;</h1>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/03-4.jpg" alt="" width="500" height="331" /></div>\r\n<div>&nbsp;</div>\r\n<div>Gelenkproblemen beim Hund k&ouml;nnen Sie durch richtige Ern&auml;hrung vorbeugen. Futtererg&auml;nzungsmittel k&ouml;nnen dazu beitragen, Gelenke und Knochen zu st&auml;rken. So k&ouml;nnen Sie ern&auml;hrungsbedingten Beschwerden, am besten schon angefangen im Welpenalter, vorbeugen. <br /><br />Tipp: Lassen Sie sich vom Tierarzt beraten, welches Futter oder welche Nahrungserg&auml;nzung f&uuml;r die Bed&uuml;rfnisse Ihres Hundes am besten geeignet ist.</div>\r\n<div>&nbsp;</div>\r\n<h1>Vorbeugen mit schonendem Untergrund&nbsp;&nbsp;</h1>\r\n<div><img src="../../../assets/uploads/images/03-5.jpg" alt="" width="500" height="333" /></div>\r\n<div>&nbsp;</div>\r\n<div>Achten Sie beim Spaziergang mit Ihrem Hund auch auf den richtigen Untergrund. Zu harte B&ouml;den, wie etwa aus Asphalt oder Stein, federn Spr&uuml;nge nicht ab und belasten die Gelenke. Wald-, Feld- oder Wiesenuntergr&uuml;nde sind nicht nur gelenkschonender, sondern meistens auch sch&ouml;ner. Das gilt &uuml;brigens auch f&uuml;r den Schlafplatz Ihres Hundes. Sorgen Sie daf&uuml;r, dass Ihr Kaltschn&auml;uzer einen weichen Untergrund zum Schlafen hat.</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>', '48201-activedog5.jpg', 1),
(9, NULL, 'Gelenksprobleme Katzen', NULL, '<div>In allererster Linie sollte man Katzen mit Gelenkproblemen das Leben leichter machen.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/04-1.jpg" alt="" width="600" height="338" /></div>\r\n<div>&nbsp;</div>\r\n<h1>&Uuml;bergewicht vermeiden &nbsp;</h1>\r\n<div>&nbsp;&Uuml;bergewichtige Stubentiger sollten dringend abnehmen. Denn je leichter die Katze ist, desto weniger wird ihr Bewegungsapparat belastet.</div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/04-2.jpg" alt="" width="447" height="425" /></div>\r\n<div>&nbsp;</div>\r\n<h1>&nbsp;Senioren entlasten</h1>\r\n<div>Entlasten kann man die Gelenke der Senioren auch, indem man ihre Lieblingspl&auml;tze besser erreichbar macht, z.B. vor die Fensterbank einen Stuhl stellt, in den Kratzbaum mehr Etagen einbaut oder einen Fu&szlig;schemel vor den Lieblingssessel stellt. W&auml;hrend man gro&szlig;e Spr&uuml;nge so vermeidet, sollte man Bewegung z. B. durch Spiel f&ouml;rdern. INSERT INTO `static_pages` (`id`, `parent_page`, `title`, `short_description`, `body`, `image`, `active`) VALUES
