 </div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/04-3.jpg" alt="" width="600" height="400" /></div>\r\n<div>&nbsp;</div>\r\n<h1><strong>Hilfe bei der K&ouml;rperpflege  </strong></h1>\r\n<div>\r\n<p>Einige arthritische Katzen ben&ouml;tigen Unterst&uuml;tzung bei der K&ouml;rperpflege. Mit einem Putzhandschuh oder einer sehr weichen B&uuml;rste kann man auch empfindliche Stellen gut pflegen. Auch der Genital- und Analbereich sollte kontrolliert und wenn n&ouml;tig vorsichtig mit etwas Baby&ouml;l gereinigt werden. </p>\r\n</div>\r\n<div><img src="../../../assets/uploads/images/04-4.jpg" alt="" width="600" height="451" />&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h1><strong>Nahrungserg&auml;nzungsmittel gegen Knorpelabbau  </strong></h1>\r\n<div>Die richtigen Nahrungserg&auml;nzungsmittel unterst&uuml;tzen bei Gelenksproblemen. So ist bewiesen, dass Glukosamine, Glykosaminoglykane und Chondroitinsulfat dem Knorpelabbau entgegenwirken, Omega-3- Fetts&auml;uren sind entz&uuml;ndungshemmend. Oftmals sind diese Stoffe bereits in guten Seniorenfuttermitteln enthalten. Ob eine zus&auml;tzliche Versorgung damit sinnvoll ist, sollten Sie mit Ihrem Tierarzt besprechen.</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>', 'a2f88-activedog5.jpg', 1),
(10, NULL, 'Einsatzgebiete von Gelenkspräparaten', NULL, '<div>Einsatzgebiete von Gelenkspr&auml;paraten</div>\r\n<div>&nbsp;</div>\r\n<div>Ein gutes Gelenkpr&auml;parat hat sowohl in der Prophylaxe wie auch in der Therapiebegleitung von Gelenkerkrankungen einen positiven Einfluss auf die Bestandteile des Tiergelenks.<br /><br />Aus diesem Grund finden erfolgreiche Pr&auml;parate ihren Einsatz auch bei Tieren aller Altersgruppen, da in jeder Lebensphase verschiedene Faktoren auf das empfindliche &bdquo;System Gelenk&ldquo; einwirken und es sch&auml;digen k&ouml;nnen. </div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/05-1.jpg" alt="" width="600" height="381" /></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Zu diesen Faktoren geh&ouml;rt u.a &hellip;.</strong></div>\r\n<div>&nbsp;</div>\r\n<h1>Arthrose (degenerative Gelenkerkrankung)&nbsp;</h1>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/05-2.jpg" alt="" width="436" height="400" />&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Sie beginnen mit einer Verletzungen im Gelenkknorpelbereich. Ursache solcher Knorpelsch&auml;den k&ouml;nnen z. B. traumatische Verletzungen (Zerrung, Verstauchung), Wachstumsst&ouml;rungen (OCD), die Folgen anatomischer Fehlstellungen (HD), &uuml;berm&auml;&szlig;iger Verschlei&szlig; bei alten oder &uuml;bergewichtigen Tieren oder die Folge bakterieller Infektionen sein. In jedem Fall kommt es zu einer Reihe von Ver&auml;nderungen: <br />Der gesch&auml;digte Knorpel provoziert eine Entz&uuml;ndung der Synovialmembran, die Membran schwillt stark an und sezerniert vermehrt Synovia (Reizerguss). Dies und eine gleichzeitige Entz&uuml;ndung der Gelenkkapsel f&uuml;hren zur Schwellung und verst&auml;rkten Durchblutung des Gelenks. Die Entz&uuml;ndungssymptome R&ouml;tung, Schwellung, Schmerz und Funktionsst&ouml;rung des Gelenks (Lahmheit) werden sichtbar.<br /> <br />Im Anschluss daran kommt es zu einer fasrigen Verdickung der Gelenkkapsel, zur Ausbildung so genannter "Osteophyten" (Zubildungen am Knochen) und zur irreversiblen Gelenkknorpeldegeneration. Eine chronische Gelenkerkrankung - die Arthrose - ist entstanden. </div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h1>Verst&auml;rkte Beanspruchung bei Sporthunden:&nbsp;</h1>\r\n<div><img src="../../../assets/uploads/images/05-3.jpg" alt="" width="600" height="375" /></div>\r\n<div>&nbsp;</div>\r\n<div>Bei allen aktiven Sport- u. Gebrauchshunden (z. B. Agility, Schlittenhundesport, Windhunderennen, Jagd-, H&uuml;te-, Schutzhunde), sowie bei Hunden, die z. B. durch lange Fahrradtouren im Sommer oder ausgiebiges Bergwandern im Urlaub vermehrt gefordert sind, kann ein gezielt eingesetztes Pr&auml;parat eine wertvolle Unterst&uuml;tzung in der Gesundheitsprophylaxe darstellen.<br /><br /><br />So haben beispielsweise Untersuchungen an Windhunden, die im Rennsport eingesetzt werden, gezeigt, dass sich durch gezielte Nahrungserg&auml;nzung zum einen die Rennleistung deutlich steigerte und zum anderen die Erholungsphase nach dem Rennen merkbar k&uuml;rzer war.<br /> <br />Bei Hunden, deren Bewegungsapparat einer erh&ouml;hten Belastung ausgesetzt ist, bew&auml;hrt sich daher die unterst&uuml;tzende Gabe eines passenden Pr&auml;parates.</div>\r\n<div>\r\n<p>Die Vorteile:</p>\r\n<p>&bull; Der Knorpel wird in seiner Funktion als Sto&szlig;d&auml;mpfer gest&auml;rkt.<br />&bull; Die Belastungsf&auml;higkeit von B&auml;ndern und Sehnen wird gesteigert.<br />&bull; Sportverletzungen und vorzeitigen Abnutzungserscheinungen wird vorgebeugt.<br />&bull; Der Organismus wird in Reparationsprozessen der Gelenkstrukturen unterst&uuml;tzt.</p>\r\n</div>\r\n<h1><strong>Hundesenioren:</strong></h1>\r\n<div>&nbsp;</div>\r\n<div>Mit zunehmendem Alter vermindert sich die Syntheserate des Gelenkstoffwechsels Ihres Hundes. Abbauprozesse schreiten jedoch unver&auml;ndert voran und erh&ouml;hen damit den Verschlei&szlig; und das Risiko von Arthrosen. Genau abgestimmte Pr&auml;parate kurbeln den Stoffwechsel &auml;lterer Tiere an, um diese Imbalance wieder ins Gleichgewicht zu bringen. Sie unterst&uuml;tzen Ihren Hund im Umgang mit beginnenden oder auch bereits vorhandenen Arthrosen, die mit Bewegungsst&ouml;rungen einhergehen.  </div>\r\n<div>&nbsp;</div>\r\n<div>Das hei&szlig;t :<br />Mehr Lebensfreude im Alter</div>\r\n<div>&nbsp;</div>\r\n<div><img src="../../../assets/uploads/images/05-5.jpg" alt="" width="600" height="464" /></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>', '50b23-activedog5.jpg', 0);
hat das Erg&auml;nzungsfuttermittel Canosan&reg; seit Jahren die Nase vorn. Canosan&reg; dient der Regulierung, Stabilisierung und Regeneration von Bindegewebsstrukturen wie Knorpel, Sehnen, B&auml;nder und Gelenkkapseln. Das hochwertige Naturprodukt stellt den Gelenkstrukturen wichtige Bausteine zur Verf&uuml;gung und sorgt daf&uuml;r, dass diese auch dort ankommen, wo sie ben&ouml;tigt werden.<br /><br />Die besonderen Eigenschaften von Canosan&reg; beruhen auf seinem wertvollen Bestandteil Gonex&reg; mit aktivem GLME (Gr&uuml;nlippmuschel-Extrakt) der nur in Canosan&reg; enthalten ist. Achten Sie daher auf das Gonex&reg;-G&uuml;tesiegel, das f&uuml;r h&ouml;chste Qualit&auml;tsanspr&uuml;che steht.<br /><br />Canosan&reg; Pellets mit 4 % Gonex&reg;<br /><br />&bull; die gesunde Erg&auml;nzung in jedem Futternapf<br />&bull; ideal f&uuml;r den dauerhaften bis lebenslangen Einsatz<br />&bull; Elimination der h&auml;ufigsten Allergene<br /><br />Gonex&reg; - der feine Unterschied<br /><br />Aktives Futter f&uuml;r aktive Hunde ...<br /><br />Derzeit sind eine Vielzahl von Produkten mit Gr&uuml;nlippmuschel-Extrakt auf dem Markt erh&auml;ltlich, deren Extrakt-Mengen eine gro&szlig;e Bandbreite aufweisen.  In diesem Zusammenhang ist es wichtig zu wissen, dass "viel" nicht automatisch auch viel hilft. Entscheidend f&uuml;r die Effektivit&auml;t des Produktes ist n&auml;mlich nicht die absolut enthaltene Menge an Gr&uuml;nlippmuschel-Extrakt, sondern dessen Qualit&auml;t bzw. Aktivit&auml;t.  In Canosan&reg; mit Gonex&reg; ist der h&ouml;chstm&ouml;gliche Aktivit&auml;tsgrad durch einen besonderen, standardisierten Produktionsprozess von der Ernte bis zur Abf&uuml;llung gew&auml;hrleistet:<br /><br /> <br /> Ernte: <br /> <br />F&uuml;r Canosan&reg; mit Gonex&reg; werden nur kontrolliert angebaute Zuchtmuscheln zum Zeitpunkt maximaler N&auml;hrstoffkonzentration geerntet.<br /><br /> <br /> Extraktgewinnung: <br /> <br />Die Muscheln werden ohne Hitzeeinwirkung ge&ouml;