(12, NULL, 'Cosequin DS', NULL, '<p><strong>Cosequin DS:</strong></p>\r\n<p>shop link for Consequin with picture**************</p>\r\n<p><br />Cosequin DS - zur Unterst&uuml;tzung der Gelenkfunktion bei wachsenden, alternden Hunden und Sporttieren</p>\r\n<p>Die wesentlichen ern&auml;hrungsphysiologischen Merkmale dieses leckeren und bew&auml;hrten Erg&auml;nzungsfutters Cosequin DS beruhen insbesondere auf seinem Gehalt an ausgew&auml;hlten Zutaten sowie auf der besonders schonenden Verarbeitung. Hierdurch werden bei wachsenden, alternden oder Sport treibenden Hunden die Gelenkfunktion unterst&uuml;tzt und ern&auml;hrungsbedingte Mangelsituationen des Gelenkstoffwechsels vermieden bzw. ausgeglichen</p>\r\n<p><strong>F&uuml;tterung</strong><br />Hunde 4-10kg f&uuml;r 4 bis 6 Wochen 1 Tab, danach &frac12; Tabs - oder 1 Kapsel f&uuml;r 4 bis 6 Wochen, danach &frac12; Kapsel pro Tag<br />Hunde 11-25kg f&uuml;r 4 bis 6 Wochen 2 Tabs, danach 1 Tab - oder 2 Kapsel f&uuml;r 4 bis 6 Wochen, danach 1 Kapsel pro Tag<br />Hunde 26-50kg f&uuml;r 4 bis 6 Wochen 3 Tabs, danach 1-2 Tabs - oder 3 Kapsel f&uuml;r 4 bis 6 Wochen, danach 1-2 Kapseln pro Tag<br />Hunde &uuml;ber 50kg f&uuml;r 4 bis 6 Wochen 4 Tabs, danach 2 Tabs - oder 4 Kapsel f&uuml;r 4 bis 6 Wochen, danach 2 Kapseln pro Tag</p>\r\n<p>Die Cosequin DS Tabs werden als Leckerli zwischendurch oder zusammen mit der &uuml;blichen Nahrung verf&uuml;ttert. Die Aufteilung der angegebenen Menge auf zwei Mahlzeiten pro Tag ist empfehlenswert.<br />Die Cosequin DS Kapseln k&ouml;nnen ganz oder durch Auseinanderziehen der Kapsel und Streuen des Pulvers auf das Futter gegeben werden. Wenn der Hund nur Trockenfutter frisst, bitte dieses kurz anfeuchten, damit das Pulver haften bleibt.</p>\r\n<p>Hinweis<br />K&uuml;hl (nicht &uuml;ber 20&deg;C) und trocken lagern! Au&szlig;erhalb der Reichweite von Kindern aufbewahren!</p>\r\n<p>Zusammensetzung pro Tablette mit 2g<br />Glucosamin HCI (&gt;99% Reinheitsgrad) 500mg (25%), Chondroitinsulfat (100% Reinheitsgrad) 400mg (20%), Magnesiumstearat 5mg (0,25%)<br />Zusammensetzung pro Streukapsel 1,04g<br />Glucosamin HCI (&gt;99% Reinheitsgrad) 500mg (47,8%), Chondroitinsulfat (100% Reinheitsgrad) 400mg (38,2%), Magnesiumstearat 6mg (0,57%), Gelatine 120mg (11,5%)</p>\r\n<p>Inhaltsstoffe<br />Rohprotein 20,8%, Rohfette 1,2%, Rohfaser 21,8%, Rohasche 7,2%</p>\r\n<p>Zusatzstoffe je kg (Tablette)<br />Mangan als Mangansulfat 3.200mg, mikrokristalline Cellulose, kolloidales Siliciumdioxid<br />Zusatzstoffe je kg (Streukapsel)<br />E5 Mangan als Mangansulfat-Monohydrat 6.119mg</p>\r\n<p>Wie wirkt Cosequin&reg; ?</p>\r\n<p>Die exklusive Kombination von niedermolekularem Natrium Chondroitinsulfat (TRH122&reg;*), Glukosamin-HCL (FCHG49&reg;*) und Mangan im Cosequin&reg; wirken zusammen auf die Strukturerhaltung des Gelenkknorpels Ihres Hundes und verlangsamen gleichzeitig deren Abbauenzyme. Das Glukosamin-HCL ist der eigentliche Baustein des Knorpels, liefert einen Schl&uuml;sseln&auml;hrstoff, der die Knorpelzellen gesund h&auml;lt und sie korrekt funktionieren l&auml;sst. Das Chondroitinsulfat hemmt die Enzyme, die das Knorpelgewebe abbauen. Cosequin&reg; ist die einzige Marke von Glukosamin/Chondroitinsulfat Pr&auml;paraten dessen Wirksamkeit, Sicherheit und Bioverf&uuml;gbarkeit durch kontrollierte und in USA ver&ouml;ffentlichte veterin&auml;rmedizinische Studien nachgewiesen worden sind. Als grosses Molek&uuml;l kann Chondroitinsulfat nur schwer absorbiert werden. Cosequin&reg; ist das einzige Produkt, in dem absolut reines niedermolekulares Chondroitinsulfat zum Einsatz kommt, welches f&uuml;r die Absorption optimiert wurde. Niedrigeres Molekulargewicht bedeutet, dass die Partikelgr&ouml;sse des Molek&uuml;ls auch kleiner ist, und somit durch das Verdauungssystem leichter zu absorbieren als weniger reine Formen von Chondroitinsulfat. Diese hochreine Form von Chondroitinsulfat ist zwar teurer, ist aber die einzige deren Wirksamkeit, Sicherheit und Absorption durch kontrollierte und ver&ouml;ffentlichte veterin&auml;rmedizinische Studien nachgewiesen worden sind.</p>\r\n<p>&nbsp;</p>\r\n<p>shop link for Consequin with picture*************</p>\r\n<p>&nbsp;</p>', 'e2719-page_header_dog.png', 1),
(13, NULL, 'Synoquin® EFA', NULL, '<div><strong>Synoquin&reg; EFA f&uuml;r Hunde</strong></div>\r\n<div>&nbsp;</div>\r\n<div>shop link for Consequin with picture***************</div>\r\n<div>&nbsp;</div>\r\n<div>Synoquin&reg; EFA ist Gro&szlig;britanniens f&uuml;hrendes Gelenkserg&auml;nzungsfuttermittel. Neu ist es mit verbesserter Formel auch in der Schweiz erh&auml;ltlich.  Synoquin&reg; EFA &uuml;berzeugt mit seiner Zusammensetzung, welche mit 5 spezifischen Zutaten die Gelenke optimal unterst&uuml;tzt.  <br /><br />small breed &lt;10kg <br />medium breed 10-25kg <br />large breed &gt;25kg<br /><br /><br />Damit ein Gelenk gesund bleibt, braucht es stetig eine Versorgung von speziellen Schl&uuml;sselbausteinen. Diese sind aber nicht immer in ausreichender Form im Futter zu finden. Synoquin&reg; sorgt daf&uuml;r, dass auch wenn der Bedarf h&ouml;her ist (bei Gelenksproblemen), die Versorgung ausreichend ist.<br /><br /><br /><strong>Vorteile von Synoquin&reg; EFA</strong><br /><br />&bull; In Synoquin&reg; EFA finden sich ausschliesslich qualitativ hochstehendes Chondroitinsulphat, Dexahan&reg; und Glucosamin<br />&bull; Chondroitin und Glucosamin sind wirksame Helfer, um vor Gelenksdegeneration zu sch&uuml;tzen<br />&bull; Studien zeigen, dass Glucosamin in Kombination mit Dexahan&reg; eine bessere schmerzlindernde Wirkung besitzt, als Glucosamin alleine<br />&bull; Regelm&auml;ssige Kontrollen der Inhaltsstoffe sowie dem Fertigprodukts garantieren einen genauen Gehalt der Inhaltsstoffe und eine hohe Reinheit<br />&bull; bestverkauftes Produkt in Grossbritannien<br /><br /><br />Die einzigartige Formel enth&auml;lt f&uuml;nf wichtige Zutaten, von welchen jede eine spezifische Rolle spielt :<br /><br /><strong>Glucosamine HCI:</strong><br /><br />Glucosamine dienen als wichtigste Bausteine f&uuml;r die Produktion neuer und gesunder Glykosaminglykane (GAG\'s). Es f&ouml;rdert die Produktion von Gelenksfl&uuml;ssigkeit und Knorpel, sorgt f&uuml;r eine gute Qualit&auml;t der Glykosaminglykane und hilft so, die Gelenksfunktion zu verbessern und aufrechtzuerhalten.  <br /><br /><strong>Dexahan&reg; :</strong><br /><br />Dexahan ist eine reine Form von Krill und gilt als beste Quelle von essentiellen Fetts&auml;uren. Dexahan hemmt die Herstellung von Entz&uuml;ndungszellen, dient als Vorl&auml;ufer von nat&uuml;rlichen entz&uuml;ndungshemmenden Mediatoren (z.B. Protekine &amp; Resolvine) und hilft, die Dichte der Mineralien im erkrankten Gelenk wieder aufzubessern.  <br /><br /><strong>Vitamin C:</strong><br /><br />Vitamin C ist der f&uuml;hrende k&ouml;rpereigene "Reaktionshemmer" und wirkt gezielt gegen die Produktion freier Radikale der Gelenke (sogenannter "altmacher")  <br /><br /><strong>Zink:</strong><br /><br />Zink ist ein wichtiger Bestandteil bei der Produktion von Knorpelsubstanz. Ausserdem hilft es bei enzymatischen Prozessen im ganzen K&ouml;rper.  <br /><br /><strong>Chondroitin:</strong><br /><br />Chondroitin ist f&uuml;r die "stossd&auml;mpferische" Funktion im Gelenk verantwortlich. Es ist das prim&auml;re Glykosaminglykan im Knorpel, stimuliert die k&ouml;rpereigene Produktion dieser, h&auml;lt die Gelenksfl&uuml;ssigkeit gesund und aufrecht und stellt die Zugfestigkeit sicher (bindet das Wasser im Knorpel, welches sich dann wiederum mit dem Kollagen verbindet).<br /><br /></div>\r\n<div>shop link for Consequin with picture***</div>\r\n<div>\r\n<div>&nbsp;</div>\r\n</div>', '04f61-page_header_dog.png', 1),
