(14, NULL, 'Krankenversicherung für den Hund', NULL, '<p><strong>Krankenversicherung f&uuml;r den Hund</strong></p>\r\n<p>Ist eine Absicherung f&uuml;r den Hund im Krankheitsfall sinnvoll oder nicht? Dieses Thema ist immer aktuell. Sicher ist diese Versicherungsart in Deutschland weit weniger verbreitet wie in anderen europ&auml;ischen L&auml;ndern. So sind in Skandinavien 50% und in Gro&szlig;britannien 25% aller Hunde krankenversichert. In Deutschland liegt die Zahl deutlich darunter bei nur 2% - aber mit deutlich zunehmender Tendenz.</p>\r\n<p>Die Geb&uuml;hren f&uuml;r die Behandlung beim Tierarzt wurden vor kurzer Zeit um 12% erh&ouml;ht. Auch die technischen M&ouml;glichkeiten und damit die Behandlungskosten steigen. Daher denken heute immer mehr Hundehalter dar&uuml;ber nach, eine Hundekrankenversicherung abzuschlie&szlig;en.</p>\r\n<p><br /><br /><img src="../../../assets/uploads/images/09-1.jpg" alt="" width="396" height="303" /><br /><br /></p>\r\n<p><img src="../../../assets/uploads/images/09-2.jpg" alt="" width="396" height="244" /></p>', '681b0-page_header_dog.png', 1),
(17, NULL, 'DATENSCHUTZERKLäRUNG', NULL, '<p>Anonyme Datenerhebung</p>\r\n<p>Wir freuen uns, dass Sie unseren Shop besuchen und bedanken uns f&uuml;r Ihr Interesse an unserem Unternehmen, unseren Produkten und unseren Webseiten. Der Schutz Ihrer Privatsph&auml;re bei der Nutzung unserer Webseiten ist uns wichtig. Daher nehmen Sie bitte nachstehende Informationen zur Kenntnis:</p>\r\n<p>1. Erhebung, Verarbeitung und Nutzung personenbezogener Daten<br />Sie k&ouml;nnen unsere Webseiten grunds&auml;tzlich besuchen, ohne dass wir personenbezogene Daten von Ihnen erheben. Personenbezogene Daten werden nur erhoben, wenn Sie uns diese von sich aus zur Durchf&uuml;hrung eines Vertrages, bei der Er&ouml;ffnung eines Kundenkontos oder im Rahmen der Kontaktaufnahme mitteilen. Diese Daten werden ohne Ihre ausdr&uuml;ckliche Einwilligung jeweils allein zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen genutzt. Nach vollst&auml;ndiger Abwicklung des Vertrages und vollst&auml;ndiger Kaufpreisbezahlung werden Ihre Daten mit R&uuml;cksicht auf steuer- und handelsrechtliche Aufbewahrungsfristen gespeichert, nach Ablauf dieser Fristen gel&ouml;scht.<br />Dar&uuml;ber hinaus werden personenbezogene Daten erhoben, wenn Sie sich zu unserem E-Mail-Newsletter anmelden. Diese Daten werden von uns zu eigenen Werbezwecken in Form unseres E-Mail-Newsletters genutzt, sofern sie hierin ausdr&uuml;cklich eingewilligt haben wie folgt:</p>\r\n<p>"Newsletter abonnieren"</p>\r\n<p>Sie k&ouml;nnen den Newsletter jederzeit &uuml;ber den daf&uuml;r vorgesehenen Link im Newsletter oder durch entsprechende Nachricht an uns abbestellen. Nach erfolgter Abmeldung wird Ihre E-Mailadresse unverz&uuml;glich gel&ouml;scht.</p>\r\n<p>2. Weitergabe personenbezogener Daten<br />2.1 Bestellabwicklung<br />- Erfolgt die Zustellung der Ware durch den Transportdienstleister DHL (Deutsche Post AG, Charles-de-Gaulle-Stra&szlig;e 20, 53113 Bonn), so geben wir Ihre E-Mail-Adresse vor der Zustellung der Ware zum Zwecke der Abstimmung eines Liefertermins an DHL weiter, sofern Sie hierin ausdr&uuml;cklich eingewilligt haben wie folgt:</p>\r\n<p>"Ich bin damit einverstanden, dass meine E-Mail-Adresse an DHL (Deutsche Post AG, Charles-de-Gaulle-Stra&szlig;e 20, 53113 Bonn) weitergegeben wird, damit DHL vor der Zustellung der Ware zum Zwecke der Abstimmung eines Liefertermins per E-Mail Kontakt mit mir aufnehmen kann. Meine diesbez&uuml;glich erteilte Einwilligung kann ich Ihnen gegen&uuml;ber jederzeit widerrufen."</p>\r\n<p>Anderenfalls geben wir nur den Namen des Empf&auml;ngers und die Lieferadresse an DHL weiter. In diesem Fall ist eine vorherige Abstimmung des Liefertermins mit DHL nicht m&ouml;glich.<br />Die von uns erhobenen personenbezogenen Daten werden im Rahmen der Vertragsabwicklung an das mit der Lieferung beauftragte Transportunternehmen weitergegeben, soweit dies zur Lieferung der Ware erforderlich ist.</p>\r\n<p>3. Cookies<br />Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu erm&ouml;glichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endger&auml;t abgelegt werden. Einige der von uns verwendeten Cookies werden nach dem Ende der Browser-Sitzung, also nach Schlie&szlig;en Ihres Browsers, wieder gel&ouml;scht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endger&auml;t und erm&ouml;glichen uns oder unseren Partnerunternehmen, Ihren Browser beim n&auml;chsten Besuch wiederzuerkennen (persistente Cookies). Sie k&ouml;nnen Ihren Browser so einstellen, dass Sie &uuml;ber das Setzen von Cookies informiert werden und einzeln &uuml;ber deren Annahme entscheiden oder die Annahme von Cookies f&uuml;r bestimmte F&auml;lle oder generell ausschlie&szlig;en. Bei der Nichtannahme von Cookies kann die Funktionalit&auml;t unserer Website eingeschr&auml;nkt sein.</p>\r\n<p>4. Einsatz von Google AdSense<br />Diese Website benutzt Google AdSense, einen We